pragma solidity ^0.6.2;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

interface IEngine {
    function buy(uint256 offerIndex, address to, uint256 amount) external payable;
}

contract SatoshiART1155 is ERC1155 {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;
    address public owner;

    IEngine _engine;

    // Data of each token
    struct TokenData {
        address payable creator;
        uint256 royalties;
    }
    mapping(uint256 => TokenData) public tokens;

    uint128 bpArtists = 9750; // 94.00 in basis points (parts per 10,000)
    uint128 bpPlatform = 250; // 6% for the platform

    constructor(address engine) public ERC1155("www.luispando.com/tokens/{id}.json") {
        owner = msg.sender;
        _engine = IEngine(engine);
    }

    function ImAlive() public view returns (uint256) {
        return 1;
    }

    // returns the creator of the token
    function getCreator(uint256 _id) external returns (address) {
        return tokens[_id].creator;
    }

     function getRoyalties(uint256 _id) external returns (uint256) {
        return tokens[_id].royalties;
    }
    function createItem(
        address engine,
        uint256 _amount, // amount of tokens for this item
        uint256 _royalties // amount of royalties in bp
    ) public returns (uint256) {
        require(_royalties <= 1000, "Royalties too high"); // you cannot set all royalties + commision. So the limit is 2% for royalties
        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();

        // mint the NFT tokens of the collection
        _mint(msg.sender, newItemId, _amount, "");

        // approves the engine to deal with the token
        setApprovalForAll(engine, true);
        // save the token data
        tokens[newItemId] = TokenData({creator: msg.sender, royalties: _royalties});

        return newItemId;
    }

    function buyItem(
        uint256 offerIndex,
        uint256 amount
    ) external payable {
        _engine.buy{value: msg.value}(offerIndex, msg.sender, amount);
    }
}
